window.bookSummaryJSON = "<p><b>On just another average day, Jake finds himself in a forest filled with monsters, dangers, and opportunity....</b></p> <p>It was a day like any other when suddenly the world changed. The universe reached a threshold humanity didnâ€™t even know existed, and it was time to finally be integrated into the vast multiverse. A place where power is the only thing anyone can truly rely on.</p> <p>Jake, a seemingly average office worker, finds himself thrust into this new world. Into a tutorial filled with dangers and opportunities.</p> <p>His new reality should breed fear and concern. His fellow coworkers falter at every turn. Jake, however, finds himself thriving.</p> <p>Perhaps... This is the world Jake was meant to be born in.</p> <p><b>Don't miss the start of this hit LitRPG fantasy series with millions of views on Royal Road. Grab your copy of</b><b><i> Primal Hunter </i></b><b>today on Kindle, Kindle Unlimited, or Audible (narrated by Travis Baldree).</b></p> <p><b>About the Series: </b>Experience an apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of progression fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. As he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
